import React from 'react';
import '../App.css';
import TodosList from "./TodosList"
import DoneList from "./DoneList"

function App() {
  return (
    <div className="App">
      <div className="container">
        <div className="row">
          <TodosList></TodosList>
          <DoneList></DoneList>
        </div>
      </div>

    </div>
  );
}

export default App;
